import React from "react";
import axiosInstance from "../User/axiosApi";

async function SimilarPosts(post_theme) {
    try {
        const response = await axiosInstance.post('api/posts/similar/' + post_theme.toString() + '/')

        return response.data; 

    } catch (error) {
        console.log(error);
    }
}


export default SimilarPosts;
